import React from "react";

import Image from "next/image";

import { PictureContainer } from "./styles";

function ProfilePicture() {
  return (
    <PictureContainer>
      <Image
        className="rounded"
        src="/images/lq_2.jpg"
        alt="Long-Quan"
        layout="fill"
        objectFit="cover"
        objectPosition="top top"
        quality={75}
      />
    </PictureContainer>
  );
}

export default ProfilePicture;
